import './App.css';
// This is a React Router v6 app
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

function App() {


  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={
            <div>Hello you are in /</div>
          }/>
          <Route path="/user" element={
            <div>Hello user!</div>
          }/>
          <Route />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
